// frontend/src/Components/Results.js
import React, { useState, useEffect } from 'react';
import './Results.css';

const Results = ({ identifiedInstrument }) => {
    const [showDetails, setShowDetails] = useState(false);
    const [spectrogramData, setSpectrogramData] = useState(null);
    const [comparativeData, setComparativeData] = useState(null);

    useEffect(() => {
        fetchSpectrogramData();
        fetchComparativeData();
    }, []);

    const toggleDetails = () => {
        setShowDetails(!showDetails);
    };

    const fetchSpectrogramData = async () => {
        // Fetch spectrogram data from backend
        const data = await fetch('/api/spectrogram').then(res => res.json());
        setSpectrogramData(data);
    };

    const fetchComparativeData = async () => {
        // Fetch comparative analysis data from backend
        const data = await fetch('/api/comparative-analysis').then(res => res.json());
        setComparativeData(data);
    };

    return (
        <div className="results">
            <h3>Resultados del Análisis</h3>
            <div className="graph-container">
                <div className="graph-placeholder">
                    <p>Gráficas del análisis se mostrarán aquí</p>
                </div>
            </div>
            <p>Precisión en la identificación de instrumentos:</p>
            <ul>
                <li><span className="instrument">Quena:</span> <span className="accuracy">85%</span></li>
                <li><span className="instrument">Bombo:</span> <span className="accuracy">78%</span></li>
                <li><span className="instrument">Charango:</span> <span className="accuracy">92%</span></li>
            </ul>
            <button className="andean-button" onClick={toggleDetails}>
                {showDetails ? "Ocultar detalles" : "Ver más detalles"}
            </button>
            {showDetails && (
                <div className="details-container">
                    <p>Aquí se muestran los detalles sobre la precisión y el análisis de los instrumentos identificados utilizando técnicas de machine learning.</p>
                    <p>Por ejemplo, la Quena fue identificada correctamente en el 85% de los casos debido a sus características únicas en el espectro de frecuencia...</p>
                </div>
            )}
            <div className="additional-info">
                <div className="spectrogram">
                    <h4>Espectrograma</h4>
                    {/* Render spectrogram data */}
                    {spectrogramData ? (
                        <img src={`data:image/png;base64,${spectrogramData}`} alt="Spectrogram" />
                    ) : (
                        <p>Cargando espectrograma...</p>
                    )}
                </div>
                <div className="comparative-analysis">
                    <h4>Análisis Comparativo</h4>
                    {/* Render comparative analysis data */}
                    {comparativeData ? (
                        <div>{/* Render comparative data */}</div>
                    ) : (
                        <p>Cargando análisis comparativo...</p>
                    )}
                </div>
            </div>
        </div>
    );
};

export default Results;
